import React, { Component } from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
  width: 200px;
  height: 250px;
  background: green;
`

const Image = styled.div`
  width: 100%;
  background: red;

  &:after {
    content: '';
    display: block;
    padding-bottom: 100%;
  }
`

class Box extends Component {
  render() {
    return (
      <Wrapper>
        <Image />
      </Wrapper>
    )
  }
}

export default Box
